<div class="entities" style="line-height: 2.5; direction: ltr">Cytokine-induced human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - secreting effector-memory Th cells in chronic autoimmune inflammation . T-helper ( Th ) cells activated by cytokines in the absence of T-cell receptor ligation are suspected to participate in inflammatory processes by production of interferon-gamma ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Still , the relevance of such a mechanism has not been addressed in humans . Here we demonstrate that a subset of human effector-memory Th cells expressing functional interleukin - 12R ( IL - 12R ) , IL - 18Ralpha , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P51681
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ex vivo can be induced to secrete 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 by cytokines signaling via the IL - 2R common gamma-chain in combination with IL - 12 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q14116
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . Cytokine-driven 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 production depends on 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P52333
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - and p38 mitogen-activated kinase signals and is sensitive to suppression by CD25 ( + + ) regulatory T cells . Contrary to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( + ) Th cells induced upon antigen-specific stimulation , their cytokine-activated counterparts characteristically lack expression of costimulator 4-1 BB ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q07011
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Strikingly , the majority of Th cells infiltrating inflamed joints of rheumatoid arthritis patients is equipped with receptors prerequisite for cytokine-induced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 secretion . Among these cells , we detected a substantial fraction that secretes 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01579

</mark>
 directly ex vivo but lacks 4-1 BB expression , indicating that cytokine-induced

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Kinase inhibitors : a new class of antirheumatic drugs . The outlook for patients with rheumatoid arthritis has improved significantly over the last three decades with the use of disease-modifying antirheumatic drugs . However , despite the use of methotrexate , cytokine inhibitors , and molecules targeting T and B cells , a percentage of patients do not respond or lose their response over time . The autoimmune process in rheumatoid arthritis depends on activation of immune cells , which utilize intracellular kinases to respond to external stimuli such as cytokines , immune complexes , and antigens . In the past decade , small molecules targeting several kinases , such as p38 MAPK , Syk , and JAK have been developed . Several p38 MAPK inhibitors proved ineffective in treating rheumatoid arthritis . The Syk inhibitor , fostamatinib , proved superior to placebo in Phase II trials and is currently under Phase III investigation .

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Beyond statins : new lipid lowering strategies to reduce cardiovascular risk . Statins are the first-line therapy in LDL - DB04540 ( LDL-C ) reduction and its clinical use has contributed to significant prevention and treatment of atherosclerotic vascular disease . Yet , a significant proportion of patients remain at high risk . Recently , a number of new therapies have been developed to further lower LDL-C . These agents may provide clinical benefit on top of statin therapy in patients with high residual risk , severe hypercholesterolemia or as an alternative for patients who are intolerant to statins . We review four novel approaches based on the inhibition of proprotein convertase subtilisin / kexin type 9 ( Q8NBP7 ) , apolipoprotein-B 100 ( apoB ) , Cholesteryl ester transport protein (

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Neonatal ghrelin programs development of hypothalamic feeding circuits . A complex neural network regulates body weight and energy balance , and dysfunction in the communication between the gut and this neural network is associated with metabolic diseases , such as obesity . The stomach-derived hormone ghrelin stimulates appetite through interactions with neurons in the arcuate nucleus of the hypothalamus ( Q5SW96 ) . Here , we evaluated the physiological and neurobiological contribution of ghrelin during development by specifically blocking ghrelin action during early postnatal development in mice . Ghrelin blockade in neonatal mice resulted in enhanced Q5SW96 neural projections and long-term metabolic effects , including increased body weight , visceral fat , and blood glucose levels and decreased leptin sensitivity . In addition , chronic administration of ghrelin during postnatal life impaired the normal development of Q5SW96 projections and caused metabolic dysfunction . Consistent with these observations , direct exposure of postnatal Q5SW96 neuronal explants to ghrelin blunted axonal growth and blocked the neurotrophic effect of the adipocyte-derived hormone leptin . Moreover , chronic ghrelin exposure in neonatal mice also attenuated leptin-induced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P40763
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 signaling in Q5SW96 neurons . Collectively , these data reveal that ghrelin plays an inhibitory role in the development of hypothalamic neural circuits and suggest that proper expression of ghrelin during neonatal life is pivotal for lifelong metabolic regulation .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Novel treatments with small molecules in psoriatic arthritis . Current treatment options for patients with active psoriatic arthritis ( PsA ) include synthetic disease-modifying antirheumatic drugs and biologic agents . Propelled by increased understanding of immunopathogenesis of PsA , new therapeutic agents targeting different biologic pathways have been evaluated . This article discusses novel small-molecule , orally available treatments that are currently in clinical development for the treatment of psoriasis and PsA . This includes the phosphodiesterase 4 inhibitor apremilast and Janus kinase ( JAK ) inhibitors . Apremilast has demonstrated significant improvements in patients with moderate to severe psoriasis and PsA in phase II and III clinical trials and has recently been approved for the treatment of PsA .

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in kidney transplantation . INTRODUCTION : This review will discuss the mechanism of action and important kidney transplant clinical trial data for the small molecule Janus kinase ( JAK ) 3 inhibitor tofacitinib , formerly known as CP -690,550 and tasocitinib . AREAS COVERED : Successful kidney transplantation requires adequate immunosuppression . Current maintenance immunosuppressive protocols which rely on calcineurin inhibitors have long-term nephrotoxicity and negative impact on cardiometabolic risk factors . JAKs are cytoplasmic tyrosine kinases that participate in the signaling of a broad range of cell surface receptors , particularly members of the cytokine receptor common gamma ( c ) chain family . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inhibition has immunosuppressive effects and treatment with tofacitinib in clinical trials has demonstrated efficacy in autoimmune disorders such as psoriasis and rheumatoid arthritis . Nonhuman primate models of renal transplantation demonstrated prolonged graft survival with tofacitinib compared to control . Renal transplant clinical trials in humans have demonstrated tofacitinib to be noninferior to cyclosporine in terms of rejection rates and graft survival . There was also a lower rate of new onset diabetes after transplant . However , there was a trend toward more infections , including cytomegalovirus and BK virus nephritis . EXPERT OPINION : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 may be a promising alternative to calcineurin inhibitors . The optimal therapeutic window is still being determined .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Preclinical to clinical translation of tofacitinib , a Janus kinase inhibitor , in rheumatoid arthritis . A critical piece in the translation of preclinical studies to clinical trials is the determination of dosing regimens that allow maximum therapeutic benefit with minimum toxicity . The preclinical pharmacokinetic ( PK ) / pharmacodynamic ( PD ) profile of tofacitinib , an oral Janus kinase ( JAK ) inhibitor , in a mouse collagen-induced arthritis ( mCIA ) model was compared with clinical PK / PD data from patients with rheumatoid arthritis ( RA ) . Preclinical evaluations included target modulation and PK / PD modeling based on continuous subcutaneous infusion or oral once - or twice-daily (

 heterodimers , but not

<div class="entities" style="line-height: 2.5; direction: ltr">Antiapoptotic effect of endothelin - 1 in rat cardiomyocytes in vitro . Apoptosis of cardiac myocytes is thought to be a feature of many pathological disorders , including congestive heart failure ( CHF ) and ischemic heart disease ( IHD ) . Because recent investigations indicate that endothelin - 1 ( ET - 1 ) plays an important role in CHF and IHD , we investigated the effect of ET - 1 on cardiomyocyte apoptosis . The presence of apoptosis in rat cardiomyocytes ( H9c2 and neonatal ) was evaluated by morphological criteria , electrophoresis of DNA fragments , 4 ' , 6 ' - diamidine - 2 ' - phenylindole staining , and TUNEL analysis . ET - 1 , but not angiotensin II , prevented apoptosis induced by serum deprivation via

</mark>
 receptors in a dose-dependent manner ( 1 to 100 nmol / L ) . ET - 1 also prevented cytochrome c release from mitochondria to the cytosol . The use of specific pharmacological inhibitors demonstrated that the antiapoptotic effect of ET - 1 was mediated through a tyrosine kinase pathway ( genistein and AG490 ) but not through protein kinase C ( PKC ; calphostin C ) , mitogen-activated protein kinases ( PD98059 and SB203580 ) , or PKA ( KT5270 ) pathways . Adenovirus-mediated gene transfer of kinase-inactive ( KI ) c-Src reversed the antiapoptotic effect of ET - 1 . We further investigated whether Bcl-xL , an antiapoptotic molecule , would be upregulated by using a luciferase-based reporter system . ET - 1 upregulated Bcl-xL , and this upregulation was inhibited by genistein or AG490 but not by calphostin C . The experiments with KI mutants for various tyrosine kinases revealed that c-Src and Pyk 2 ( but not

 and

 . AREAS COVERED : This review describes the pharmacokinetics of tofacitinib . Furthermore , the article summarizes and comments the drug ' s efficacy and safety profile in RA patients . The authors furthermore assess data derived from the FDA ' s RA development program . EXPERT OPINION :
